import React from "react";

const LandlordDashboard = () => {
  return (
    <div>
      <h2>Landlord Dashboard</h2>
      <p>Welcome, Landlord! Here you can manage your rental listings.</p>
    </div>
  );
};

export default LandlordDashboard;
